import React from 'react';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Carousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };

  const data = [
    {
      name: "John Doe",
      photo: "https://via.placeholder.com/150",
      paragraph: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
    },
    {
      name: "Jane Doe",
      photo: "https://via.placeholder.com/150",
      paragraph: "Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat."
    },
    {
      name: "Alice Smith",
      photo: "https://via.placeholder.com/150",
      paragraph: "Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur."
    }
  ];

  return (
    <Slider {...settings}>
      {data.map((item, index) => (
        <div key={index}>
          <img src={item.photo} alt={item.name} />
          <h3>{item.name}</h3>
          <p>{item.paragraph}</p>
        </div>
      ))}
    </Slider>
  );
};

export default Carousel;
